import React, { createContext, useState } from "react";
import "./App.css";
import Navigation from "./Navigation/Navigation";
import AboutMe from "./AboutMe/AboutMe";
import SkillsTechnologies from "./SkillsTechnologies/SkillsTechnologies";
import LeetCode from "./LeetCode/LeetCode";
import BookList from "./BookList/BookList";
import UsefulResources from "./UsefulResources/UsefulResources";
// Create Context
export const AppContext = createContext();

function App() {
  const [show, setShow] = useState(false);
  const [currentPage, setCurrentPage] = useState("AboutMe");

  // Providing context values
  return (
    <AppContext.Provider value={{ show, setShow, currentPage, setCurrentPage }}>
      <div className="App">
        <Navigation />
        {currentPage === "AboutMe" && <AboutMe />}
        {currentPage === "SkillsTechnologies" && <SkillsTechnologies />}
        {currentPage === "LeetCode" && <LeetCode />}
        {currentPage === "BookList" && <BookList />}
        {currentPage === "UsefulResources" && <UsefulResources />}
      </div>
    </AppContext.Provider>
  );
}

export default App;
